import React from "react";
import './projects.css';

export default function Projects() {
    return (
        <section id="projects">
        <div className="projects-heading">
          <span className="projects-heading-text">Projects</span>
          <span className="projects-subheading">Stuff I've made</span>
        </div>
        <div class="place" onclick="window.location.href='castel-gandolfo.html'">
                <img src="./images/gandolfo.jpg" alt="gandolfo image"></img>
                <h2>Castel Gandolfo Papal Palace</h2>
                <p>The traditional summer residence of the Pope with scenic views.</p>
            </div>
        </section>
    )
}
